  false,\n\t\"url\": null,\n\t\"notes\": \"This memorandum is concerning the request
  from the FY95 Platte-Kansas Rivers Ecosystem Work Activity Guidance for refuge managers
  to review the purposes of refuges to determine if current management reflects those
  purposes.  This is the response from Fort Niobrara/Valentine National Wildlife Refuges
  refuge manager, which contains various excerpts from policies, memorandums and letters
  that specifically address the priority currently accorded to longhorn and bison
  in management of refuge grasslands in light of the primary purpose of the refuge
  for preserving and restoring native birds\",\n\t\"license_title\": \"License Not
